description:
&quot;There's something about young, curious, somewhat innocent women being attracted to older, experienced gentleman to guide them into the mysterious and exciting world of sexual intrigue. Carmen Callaway acts on her crush with the family Doctor. Dillion Harper finally finds some time alone with her tennis coach. Bad girl Chloe Foster sexually taunts then seduces her parole officer, and Katie St. Ives finally has her way with her power-attorney boss. Reckless youthful energy combined with sophisticated experience ends up awesomely combustive.&quot;

Carmen Callaway, Nick Manning, Dillion Harper, Chloe Foster, Katie St.Ives, Steven St.Croix, Evan Stone, Tom Byron

